export default function Icons({
  name,
  size = 24,
  className = "",
  id = "",
  color = "currentColor",
  ...props
}: SvgProps) {
  const icon = svgIcons[name as keyof typeof svgIcons];

  if (!icon) {
    console.warn(
      `SVG icon "${name}" not found. Available icons: ${Object.keys(svgIcons).join(", ")}`
    );
    return null;
  }

  return (
    <svg
      xmlns="http://www.w3.org/2000/svg"
      width={size}
      height={size}
      id={id}
      viewBox={icon.viewBox}
      className={className}
      style={{ color }}
      {...props}
    >
      {icon.content}
    </svg>
  );
}

